import Message from '@minchat/js/dist/message'
import User from '@minchat/js/dist/user'
import React, { useEffect, useState } from 'react'
import { ManagerOptions, SocketOptions } from 'socket.io-client'
import MinChat, { Chat } from '.'
import MinChatContext from './MinChatContext'

export type Props = {
    apiKey: string | number
    children?: any
    user: User
    demo?: boolean
    test?: boolean
    socketOptions?: Partial<ManagerOptions & SocketOptions>
    onMessage?: (message: Message, chat: Chat) => void
}

export default function MinChatProvider({
    apiKey,
    children,
    user = { name: undefined, avatar: undefined, id: "1" },
    demo = false,
    test = false,
    socketOptions,
    onMessage
}: Props) {

    const [minChat, setMinChat] = useState(MinChat.getInstance(apiKey).init({ test, demo, socketOptions }).connectUser(user))


    // is called to reorder the chats array when a new message is sent or recieved 
    const [updateChatOrder, setUpdateChatOrder] = useState<number>(0)

    const [chats, setChats] = useState<Chat[]>()

    /** 
     * this is the user thats stored in the MinChat context
    */
    const [contextUser, setContextUser] = useState<User>(user)



    useEffect(() => {
        if (user) {
            setMinChat(value => {
                value.connectUser(user)
                return value
            })

            setContextUser(user)
        }

    }, [user])



    return <MinChatContext.Provider value={{
        minChat,
        updateChatOrder,
        setUpdateChatOrder,
        chats,
        setChats,
        onMessage,
        user: contextUser
    }} >{children}</MinChatContext.Provider>

}

